import React from 'react';

import './nav.css'

class Nav extends React.Component {
    // constructor(props) {
    //     super(props);
    //     this.state = {

    //     }
    // }
    render() {
        return (
            <div className="nav-main-div">
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Home</Link>
                        </li>
                        <li>
                            <Link to="/vehicles/">Vehicles</Link>
                        </li>
                        <li>
                            <Link to="/finance/">Finance</Link>
                        </li>
                        <li>
                            <Link to="/about/">About</Link>
                        </li>
                        <li>
                            <Link to="/contact/">Contact</Link>
                        </li>
                    </ul>
                </nav>
            </div>
        )
    }
}

export default Nav;
